## Creating Selector Components

Use the existing generic selector components:

- **Single selection**: `FormGenericSingleSelector` from `$lib/components/form/FormGenericSingleSelector.svelte`
- **Multi selection**: `FormGenericMultiSelector` from `$lib/components/form/FormGenericMultiSelector.svelte`

**Required implementation pattern:**

1. Define your entity type (from API)
2. Create an `optionMappingFunction` that maps your entity to `ExtendedOption`
3. Create a `fetchFunction` that fetches entities from the API
4. Pass these to the generic selector component

**Example**: See `src/lib/components/features/form/FormSelectorExample.svelte`

### Implementation Steps

1. **Define your entity type** (should come from `$lib/types/api-types.ts`):

```typescript
import type { Customer } from '$lib/types/api-types';
```

2. **Create the option mapping function**:

```typescript
const optionMappingFunction = (customer: Customer): ExtendedOption => ({
  value: customer.id,
  label: customer.name,
  // Add any additional fields needed for display
  metadata: {
    email: customer.email,
    status: customer.status
  }
});
```

3. **Create the fetch function**:

```typescript
import { apiRequest } from '$lib/utils/request';

const fetchCustomers = async (searchTerm: string): Promise<Customer[]> => {
  return await apiRequest<Customer[]>({
    url: 'sales/customers',
    queryParams: {
      search: searchTerm,
      limit: 50
    }
  });
};
```

4. **Use the generic selector**:

```svelte
<FormGenericSingleSelector
  {fetchFunction}
  {optionMappingFunction}
  placeholder="Select a customer"
  bind:value={selectedCustomerId}
/>
```

### Best Practices

- Always type your entities using types from `$lib/types/api-types.ts`
- Handle loading and error states within the fetch function
- Keep the option mapping function pure (no side effects)
- Use meaningful labels and include relevant metadata for display
- Consider implementing debouncing for search-heavy selectors

## Core Concepts

### Contract

A **contract** defines what data a component provides (writes) and consumes (reads). It uses TypeBox schemas for both runtime validation and TypeScript type inference.

```typescript
// DemoFilter.contract.ts
import { Type } from '@sinclair/typebox'
import type { ComponentContract } from '$lib/contexts/page-state'

export const DemoFilterContract = {
  $id: 'DemoFilter',
  provides: {
    filters: Type.Object({
      search: Type.String(),
      status: Type.Array(Type.String())
    })
  },
  consumes: {}
} as const satisfies ComponentContract
```

The contract describes the **shape** of the data, not **where** it lives.

### Binding

A **binding** maps logical names from the contract to actual namespaces in the page state.

```typescript
// In SnippetDefinition (from database)
{
  componentKey: '_poc.demofilter.DemoFilter',
  enabled: true,
  bindings: {
    provides: {
      filters: 'searchFilters'  // writes to 'searchFilters' instead of default 'filters'
    }
  }
}
```

If no binding is specified, the logical name is used as the namespace (default binding).

### PageState

The **PageState** is a reactive key-value registry that holds all shared state for a page. Components read and write to it via typed handles.

```typescript
// Simplified structure
{
  'filters': { search: 'laptop', status: ['pending'] },
  'selection': { rows: ['uuid-1', 'uuid-2'] }
}
```

## Usage

### Creating a Component with Contract

1. **Define the contract** (`MyComponent.contract.ts`):

```typescript
import { Type } from '@sinclair/typebox'
import type { ComponentContract } from '$lib/contexts/page-state'

export const MyComponentContract = {
  $id: 'MyComponent',
  provides: {
    myData: Type.Object({
      value: Type.String()
    })
  },
  consumes: {
    otherData: Type.Object({
      items: Type.Array(Type.String())
    })
  }
} as const satisfies ComponentContract
```

2. **Export contract from component** (`MyComponent.svelte`):

```svelte
<script lang="ts" module>
  export { MyComponentContract as contract } from './MyComponent.contract.js'
</script>

<script lang="ts">
  import { useProvides, useConsumes } from '$lib/contexts/page-state'
  import { MyComponentContract } from './MyComponent.contract.js'

  // Get typed handles
  const myDataHandle = useProvides(MyComponentContract, 'myData')
  const otherDataHandle = useConsumes(MyComponentContract, 'otherData')

  // Read consumed data (reactive)
  const items = $derived(otherDataHandle.get()?.items ?? [])

  // Write provided data
  function updateValue(newValue: string) {
    myDataHandle.set({ value: newValue })
  }
</script>
```

